;; **
;;; Boiler-plate code --- importing necessary things.
;; **

;; @@
(ns cooling
  (:require [gorilla-plot.core :as plot]) ; visualizing results
  (:use [mrepl core]             ; performing inference and handling results
        [embang emit runtime]))  ; defining Anglican programs
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; # A Cooling Schedule for the Two Road Example
;;; 
;;; Let us see if we can make the gas cost go up automatically without changing the algorithm.
;;; The example is the same as in 'tworoads.clj'. We will explore the idea of defining a slowly increasing gas cost source.
;;; 
;; **

;; @@
(let [gas-cost (atom nil)]
  (defn init-gas-cost [& [initial-gas-cost]] (reset! gas-cost (or initial-gas-cost 1.)))
  (defn get-gas-cost [inflation] (swap! gas-cost * inflation)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cooling/get-gas-cost</span>","value":"#'cooling/get-gas-cost"}
;; <=

;; **
;;; Every time get-gas-cost is called, a higher value is retrieved:
;; **

;; @@
(init-gas-cost)
(repeatedly 5 #(get-gas-cost 1.01))
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-double'>1.01</span>","value":"1.01"},{"type":"html","content":"<span class='clj-double'>1.0201</span>","value":"1.0201"},{"type":"html","content":"<span class='clj-double'>1.030301</span>","value":"1.030301"},{"type":"html","content":"<span class='clj-double'>1.04060401</span>","value":"1.04060401"},{"type":"html","content":"<span class='clj-double'>1.0510100501</span>","value":"1.0510100501"}],"value":"(1.01 1.0201 1.030301 1.04060401 1.0510100501)"}
;; <=

;; **
;;; Using get-gas-cost, we can slowly increase the gas cost during the inference:
;; **

;; @@
(def c1 1)
(def c2 2)
(def cb 1)
(def p1 3/4)
(def p2 1/3)

(with-primitive-procedures [get-gas-cost factor unobserve]
  (defquery tworoads "two roads example" inflation
    (let [o1 (sample (flip p1))
          o2 (sample (flip p2))
          _ (observe (flip 1.0) (or o1 o2))
          q (sample (uniform-continuous 0. 1.))
          s (sample (flip q))]

      (let [distance (if s
                       (if o1 c1 (+ c2 cb))
                       (if o2 c2 (+ c1 cb)))
            gas-cost (get-gas-cost inflation)
            log-weight (- (* distance gas-cost))]
        (observe (flip (exp log-weight)) true)
        (predict :gas-cost gas-cost)
        (predict :distance distance)
        (predict :q q)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cooling/tworoads</span>","value":"#'cooling/tworoads"}
;; <=

;; **
;;; Define the total number of iterations. The inference is not performed until we retrieve the resulting samples, but we need the number to compute a reasonable inflation rate.
;; **

;; @@
(def N 1000)
(def thin 5)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cooling/thin</span>","value":"#'cooling/thin"}
;; <=

;; **
;;; The convergence will depend on the inflation. Choose a reasonable value, such that gas cost grows, but does not cause overflow. 
;; **

;; @@
(def initial-cost 1.)
(def max-cost 10.0)
(def inflation (pow (/ max-cost initial-cost) (/ 1. (* N thin))))
inflation
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>1.0004606230728403</span>","value":"1.0004606230728403"}
;; <=

;; **
;;; We are now ready to lazily run the inference. We first init the gas cost, and then call the query. 
;; **

;; @@
(init-gas-cost initial-cost)
(def states (doquery :lmh tworoads inflation))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;cooling/states</span>","value":"#'cooling/states"}
;; <=

;; **
;;; Only now, when we retrieve the results, the inference is performed.
;; **

;; @@
(def states (take N (take-nth thin states)))
(def predicts (map get-predicts states))
(def weights (map (comp #(Math/exp %) get-log-weight) states))
(def policy (map :q predicts))
(take-nth 1000 weights)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-double'>1.0</span>","value":"1.0"}],"value":"(1.0)"}
;; <=

;; **
;;; We inferred a policy distribution. The mode of the distribution is the optimum policy.
;; **

;; @@
(plot/histogram (drop (quot N 2) policy))
(print "average policy =" (/ (reduce + (map (fn [p w] (* p w)) policy weights)) (reduce + weights)))
;; @@
;; ->
;;; average policy = 0.6411476446851156
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; It works. Let's check how the average policy converges. <font color="#00cccc">Cyan</font> is the policy averaged from the beginning to the current point, <font color="#cc00cc">magenta</font> is averaged from the current point to the end.
;;; 
;; **

;; @@
(letfn 
  [(average-policy
     [policy]
     (loop [ap []
            sum 0.
            n 0
            policy policy]
       (if-let [[q & policy] (seq policy)]
         (let [sum (+ sum q)
               n (inc n)]
           (recur (conj ap (/ sum n)) sum n policy))
         ap)))]

  (plot/compose
    (plot/list-plot (average-policy policy) :color "#00cccc" 
                    :plot-range [[0 N] [0 1]]
                    :joined true)
    (plot/list-plot (reverse (average-policy (reverse policy))) :color "#cc00cc" :joined true)))
